import React from 'react';

// Images
import Music1 from '../Images/Music1.jpg';
import Music2 from '../Images/Music2.jpeg';
import Music3 from '../Images/Music3.jpg';

// COMPONENTS
import { Parallax, ParallaxLayer } from 'react-spring/renderprops-addons';

// CSS
import '../css/Interests.css'

export default class MusicParallax extends React.Component {

    render() {
        return (

            <ParallaxLayer
                offset={1}>

                <Parallax
                    className='MusicParallax'
                    ref={ref => (this.MusicParallax = ref)}
                    pages={1.5}
                    style={{ 'height': '70vh', 'width': '100%' }}>

                    <div className='Pictures'>

                        <ParallaxLayer
                            speed={2}
                            className='Music One'
                            offset={0}>

                            <div>
                                <img src={Music2} className='Image' />
                            </div>

                        </ParallaxLayer>

                        <ParallaxLayer
                            speed={1.5}
                            className='Music Two'
                            offset={0}>

                            <div>
                                <img src={Music3} className='Image' />
                            </div>

                        </ParallaxLayer>

                        <ParallaxLayer
                            speed={1}
                            className='MusicInfo'
                            offset={1.5}>

                            <div>
                                <p>Photography is one of my favorite ways to feel free. I love taking pictures of the city.</p>
                            </div>

                            <button onClick={() => this.MusicParallax.scrollTo(0)}>⬆︎</button>

                        </ParallaxLayer>

                        <ParallaxLayer
                            speed={1.5}
                            offset={0}>

                            <div className='Cover'>
                                <img src={Music1} className='MusicParallaxImage' />
                            </div>

                        </ParallaxLayer>

                        <ParallaxLayer
                            speed={1}
                            offset={0.03}>

                            <div className='Topic'>
                                <h1>Music</h1>
                                <button onClick={() => this.MusicParallax.scrollTo(1.5)}>⬇︎</button>
                            </div>

                        </ParallaxLayer>

                    </div>

                </Parallax>


            </ParallaxLayer>

        )
    }

}
